column21:
The most commonly cited response of boreal forest species to global warming is a northward migration that tracks the climate and soil conditions (e.g., temperature and moisture) to which they are adapted;;
For example, under conditions of continued warming, in areas with drier soils and adequate drainage, forests may migrate northward into areas occupied by tundra vegetation (e.g., if soil moisture does not limit tree growth);;
One of the anticipated responses of boreal forests to global warming is the migration of tree species to higher latitudes as climate and soil conditions to which they are adapted also change

column24:
The most commonly cited response of boreal forest species to global warming is a northward migration that tracks the climate and soil conditions (e.g., temperature and moisture) to which they are adapted;;
For example, under conditions of continued warming, in areas with drier soils and adequate drainage, forests may migrate northward into areas occupied by tundra vegetation (e.g., if soil moisture does not limit tree growth);;
One of the anticipated responses of boreal forests to global warming is the migration of tree species to higher latitudes as climate and soil conditions to which they are adapted also change;;
However, the progression of forest changes within regions of discontinuous permafrost regions of Canada will be highly variable and potentially linked to local topographic variation induced by permafrost;;
If paludification occurs as a result of climate warming, boreal plant adaptation (movement toward higher latitudes) will be constrained by predicted changing soil conditions. Indeed, Crawford et al. [69] suggested that paludification may lead to a retreat rather than an advance in the northern limit of the boreal forest, contrary to general expectations

column92:
The climate change vulnerability assessment tool for drinking water sources developed by Milner et al. (2020) (Section d) pro- vides a science-based method for local water resources managers by combining statistical methods with a multi-model ensemble created from existing model simulations from multiple climate modelling centres ;; Science needs: Further characterize and reduce uncertainties associated with climate projection; 
Further characterize and reduce uncertainties associated with hydrological modeling; 
Further understand the compound impact of climate change, land use changes and urban development on the hydrological system, and on the associated management, adaptation, mitigation options.; Better characterize hydraulic systems and improve observational data (More data, long-term monitoring) ; 
Further understand climate change impact on water quality (field and modelling) ;
Develop practical models to support implementation and climate change adaptation

