column39:
""El Niño is associated with floods and drought in its severe forms."";;
""Animals and plants need freshwater to survive, and droughts can cause nearby water bodies to dry out causing them to die of thirst. The effects drought has on vegetation affect animals. Herbivorous animals that rely on them may die in severe drought, and by extension, carnivorous animals that depend on herbivorous animals too may also starve and die."";;
""Drought in most cases impacts the environment and these effects vary from region to region. However, there are some common characteristics that are mainly meteorological. For example, reduced rainfall, increased temperature, poor soil quality, poor crop performance, heat waves, bushfires, and dry air are common, due to shortage of water. Animals that normally reside deep in the bush move closer to human habitations for the purpose of abstracting water, which increases chances of zoonotic infections.""

column80:
""For example, severe drought can negatively affect air quality and, there is an increased risk for wildfires and dust storms. Particulate matter suspended in the air from these events can irritate the bronchial passages and lungs. This can make chronic respiratory illnesses worse and increase the risk of respiratory infections like bronchitis and pneumonia"";;
""drought affects farming, with financial implications and attendant decrease in food supply and increased food and drink prices."";;
""Water is one of the most important resources available, and mild enough to cause inconveniences, such as an intermittent supply of water due to rationing, or a drought can be so severe that people literally become “at risk of diseases’’ due to little or no sanitation. Water supply shortages are usually synonymous with drought due to a lack of precipitation (rain) and is often a significant source of water for rivers, and dams apart from melting glaciers.""
